Let $\mathbf A$ be an $m \times n$ matrix.
Let $i, j \in \closedint 1 m: i \ne j$
Let $\kappa_k$ denote the $k$th column of $\mathbf A$ for $1 \le k \le n$:
:$\kappa_k = \begin {pmatrix} a_{1 k} \\ a_{2 k} \\ \vdots \\ a_{m k} \end {pmatrix}$
Let $e$ be the elementary column operation acting on $\mathbf A$ as:
{{begin-axiom}}
{{axiom | n = \text {ERO} 3
        | t = Interchange columns $i$ and $j$
        | m = \kappa_i \leftrightarrow \kappa_j
}}
{{end-axiom}}
Then $e$ can be expressed as a finite sequence of exactly $4$ instances of the other two elementary column operations.
{{begin-axiom}}
{{axiom | n = \text {ERO} 1
        | t = For some $\lambda \in K_{\ne 0}$, multiply column $i$ by $\lambda$
        | m = \kappa_i \to \lambda \kappa_i
}}
{{axiom | n = \text {ERO} 2
        | t = For some $\lambda \in K$, add $\lambda$ times column $j$ to column $i$
        | m = \kappa_i \to \kappa_i + \lambda \kappa_j
}}
{{end-axiom}}

