Let $D$ be a simply connected open subset of the complex plane $\C$.
Let $\partial D$ denote the closed contour bounding $D$.
Let $f: D \to \C$ be holomorphic everywhere in $D$.
Then:
:$\ds \oint_{\partial D} \map f z \rd z = 0$
Let $\map \gamma t = e^{i t}$.
Let the domain of $\gamma$ be $\hointr 0 {2 \pi}$.
Let $\map f z = z^2$.
Then:

{{begin-eqn}}
{{eqn | l = \oint_\gamma \map f z \rd z
      | r = \int_0^{2 \pi} i e^{i t} e^{2 i t} \rd t
}}
{{eqn | r = i \int_0^{2 \pi} e^{3 i t} \rd t
}}
{{eqn | r = \frac i {3 i} \paren {e^{6 i \pi} - e^{i 0} }
}}
{{eqn | r = \frac 1 3 \paren {\cos 6 \pi + i \sin 6 \pi - \cos 0 - i \sin 0}
}}
{{eqn | r = \frac 1 3 \paren {1 - 1}
}}
{{eqn | r = 0
}}
{{end-eqn}}
{{qed}}
The Cauchy-Goursat Theorem was actually first investigated and proved by {{AuthorRef|Carl Friedrich Gauss}}, but it was just one of the things that he failed to get round to publishing.
He stated it in a letter of $1811$ to his friend {{AuthorRef|Friedrich Wilhelm Bessel}}, where he says:
:''This is a very beautiful theorem whose fairly simple proof I will give on a suitable occasion. It is connected with other beautiful truths which are concerned with series expansions.''
{{AuthorRef|Augustin Louis Cauchy}} was, however, the first to publish a proof.
{{AuthorRef|Karl Theodor Wilhelm Weierstrass|Karl Weierstrass}} independently discovered this theorem during his exercise to rebuild the theory of complex analysis from first principles.

