211946712407365853261789063861851874952.text:
Let $A$ be a class.
Let $g$ be a progressing mapping on $A$.
Let $\RR$ be the relation defined as:
:$\map \RR {x, y} \iff \map g x \subseteq y \lor y \subseteq x$
where $\lor$ denotes disjunction (inclusive "or").
Then:
{{begin-axiom}}
{{axiom | n = 1
        | q = \forall y \in \Dom g
        | ml= \map \RR {y, \O}
}}
{{axiom | n = 2
        | q = \forall x, y \in \Dom g
        | ml= \map \RR {x, y} \land \map \RR {y, x}
        | mo= \implies
        | mr= \map \RR {x, \map g y}
}}
{{end-axiom}}
where $\land$ denotes conjunction ("and").
The name '''progressing function lemma''' comes from {{BookLink|Set Theory and the Continuum Problem|Raymond M. Smullyan|ed = revised|edpage = Revised Edition}} by {{AuthorRef|Raymond M. Smullyan}} and {{AuthorRef|Melvin Fitting}}, where they refer to an '''inflationary mapping''' as a '''progressing function'''.
Hence it is reasonable to assume that this result could also be called:
:'''inflationary mapping lemma'''
:'''progressive mapping lemma'''
:'''progressing mapping lemma'''
and so on, with '''function''' replacing '''mapping''' as desired.
However, the author of this page has seen no evidence of this result anywhere but in that particular work, with any sort of name assigned to it.
Hence, while {{ProofWiki}} has settled for the term '''inflationary mapping''', this name of this result remains '''progressing function lemma'''.

