Let $\Q_{\ge 0}$ denote the set of positive rational numbers.
Consider the naturally ordered semigroup axioms:
A '''naturally ordered semigroup''' is a (totally) ordered commutative semigroup $\struct {S, \circ, \preceq}$ satisfying:
{{begin-axiom}}
{{axiom | n = \text {NO} 1
        | lc= $S$ is well-ordered by $\preceq$
        | q = \forall T \subseteq S
        | m = T = \O \lor \exists m \in T: \forall n \in T: m \preceq n
}}
{{axiom | n = \text {NO} 2
        | lc= $\circ$ is cancellable in $S$
        | q = \forall m, n, p \in S
        | m = m \circ p = n \circ p \implies m = n
}}
{{axiom | m = p \circ m = p \circ n \implies m = n
}}
{{axiom | n = \text {NO} 3
        | lc= Existence of product
        | q = \forall m, n \in S
        | m = m \preceq n \implies \exists p \in S: m \circ p = n
}}
{{axiom | n = \text {NO} 4
        | lc= $S$ has at least two distinct elements
        | q = \exists m, n \in S
        | m = m \ne n
}}
{{end-axiom}}
The algebraic structure:
:$\struct {\Q_{\ge 0}, +, \le}$
is an ordered semigroup which fulfils the axioms:
:{{NOSAxiom|2}}
:{{NOSAxiom|3}}
:{{NOSAxiom|4}}
but:
:does not fulfil {{NOSAxiom|1}}
:$\struct {\Q_{\ge 0}, +}$is not isomorphic to $\struct {\N, +}$.

